import { API, SuspenseGet, wrapPromise } from 'utils/api';

function fetchPostingDetail({ index }) {
	return API.get(`/web/PostingDetail/${index}`);
}

export const fetchWddData = ({ index = 0, userId = 0, jwt = '' }) =>
	SuspenseGet({
		url: `/web/PostingDetail/${index}?userId=${userId}`,
		headers: {
			'x-access-token': jwt,
		},
	});
